script: |
  super -f text -I q11275.spq | sort > q11275.out

inputs:
  - name: q11275.spq
    data: |
      SELECT ALL col1 - - + col1 + 12 * - 54, + 85 * + + col0 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT + col2 BETWEEN - CAST ( NULL AS INTEGER ) + - col0 * + + col0 AND - 80;
  - name: tab0

outputs:
  - name: q11275.out
    data: |
      -486	1275
      -606	7395
      -646	8245
